{"title":"[VulnAna] - dashboard 1 - puntuación global","type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v5.json",
  "description": "Puntuación",
  "autosize": {"type": "fit", "resize": true},
    "title": {
    "text": "Puntuación Global",
    "encode": {
      "title": {
        "enter": {
          "fontSize": {"value": 25}
        }
      }
    }
  },
  "config": {
    "text": {"align": "center", "baseline": "middle"}
  }
  "signals": [
  ],
  "data": [
    {
      "name": "report",
      "url": {
        "index": "vulnana_report*",
        "body": {
          "query": {
            "match_all": {
            }
          },
          "sort": [
            {
              "timestamp": {
                "order": "desc"
              }
            }
          ],
          "size": 1
        }
      },
      "format": {"property": "hits.hits"}
    },
    {
      "source": "report"
      "name": "score"
      "transform": [
        {
          "type": "flatten",
          "fields": ["_source.scanned_assets"],
          "as": ["scanned_assets"]
        },
        {
          "type": "project",
          "fields": ["scanned_assets.category_name", "scanned_assets.score", "scanned_assets.virtual_score"],
          "as": ["category","score","virtual_score"]
        },
        {
          "type": "filter",
          "expr": "datum.category == 'global'"
        },
      ]
    }
  ],
  "marks":[
    {
      "name": "background",
      "type": "rect",
      "from": {"data": "score"},
      "encode": {
        "enter": {
          #"fill": {"value": "#F4F7FD"},
          "fill": [
            {"test": "datum.score < 333", "value": "#FFD700"},
            {"test": "datum.score < 666", "value": "#FFA500"},
            {"test": "datum.score <= 900", "value": "#D31407"},
            {"test": "datum.score > 900", "value": "#7B1A1A"}
          ]
          "stroke": [
            {"test": "datum.score < 333", "value": "#FFD700"},
            {"test": "datum.score < 666", "value": "#FFA500"},
            {"test": "datum.score <= 900", "value": "#D31407"},
            {"test": "datum.score > 900", "value": "#7B1A1A"}
          ]
          "yc": {"signal": "(containerSize()[1]/2)"},
          "xc": {"signal": "containerSize()[0]/2"},
          "width": {"value": 400},
          "height": {"value": 150},
          "cornerRadius": {"value": 10},
        },
        "update": {
          "size": {"value": 35000},
          "opacity": {"value": 1},
          "strokeWidth": {"value": 15},
          
        },
        "hover": {
          "opacity": {"value": 0.5}
        }
      }
    },
    {
      "name": "score_mark",
      "type": "text",
      "from": {"data": "score"},
      "encode": {
        "enter": {
          "text": {"signal": "datum.score+'/1000'"},
          "fill": {"value": "#ffffff"},
          "fontSize": {"signal": 70},
          "yc": {"signal": "(containerSize()[1]/2)"},
          "xc": {"signal": "containerSize()[0]/2"}
        }
      }
    }
    {
      "name": "virtual_score_mark",
      "type": "text",
      "from": {"data": "score"},
      "encode": {
        "enter": {
          "text": {"signal": "'Sin riesgos asumidos: '+datum.virtual_score+'/1000'"},
          "fill": {"value": "#ffffff"},
          "fontSize": {"signal": 20},
          "yc": {"signal": "(containerSize()[1]/2)+50"},
          "xc": {"signal": "containerSize()[0]/2"}
        }
      }
    }
  ]
}"}}

