{"title":"[VulnAna] - dashboard 1 - evolución vulnerabilidades","type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v5.json",
  "autosize": {"type": "fit", "resize": true, "contains	": "padding"}
  "padding": 5
  "title": {
    "text": "Evolución de Vulnerabilidades",
    "encode": {
      "title": {
        "enter": {
          "fontSize": {"value": 25}
        }
      }
    }
  },
 "signals": [
    {
      "name": "isSelected",
      "value": 0,
      "on": [ 
        {
        "events": {"source": "scope", "type": "mouseover", "markname": "lines"},
        "update": "datum.severity"
        },
        {
        "events": {"source": "scope", "type": "mouseout", "markname": "lines"},
        "update": "{}"
        }
      ]
    },
    {
      "name": "isTotalSelected",
      "value": 0,
      "on": [ 
        {
        "events": {"source": "scope", "type": "mouseover", "markname": "total_line"},
        "update": "datum.severity"
        },
        {
        "events": {"source": "scope", "type": "mouseout", "markname": "total_line"},
        "update": "{}"
        }
      ]
    },
    {
      "name": "clear", "value": true,
      "on": [
        {
          "events": "mouseup[!event.item]",
          "update": "true",
          "force": true
        }
      ]
    },
    {
      "name": "shift", "value": false,
      "on": [
        {
          "events": "@legendSymbol:click, @legendLabel:click",
          "update": "event.shiftKey",
          "force":  true
        }
      ]
    },
    {
      "name": "clicked", "value": null,
      "on": [
        {
          "events": "@legendSymbol:click, @legendLabel:click",
          "update": "{value: datum.value}",
          "force":  true
        }
      ]
    },
  ],
  "data": [
    {
      "name": "vulns",
      "url": {
        "index": "vulnana_results*",
        "body": {
          "size": 10000,
          "query": {
            "bool": {
              "filter": [
                "%dashboard_context-filter_clause%"
              ]
            }
          }
        }
      },
      "format": {"property": "hits.hits"},
      "transform": [
        {"type": "formula", "expr": "(month(datum._source.timestamp)+1) < 10 ? '0'+(month(datum._source.timestamp)+1) : month(datum._source.timestamp)+1", "as": "month"},
        {"type": "formula", "expr": "'15/'+datum.month+'/'+year(datum._source.timestamp)", "as": "time_aux"},
        {"type": "formula", "expr": "year(datum._source.timestamp)+'-'+datum.month+'-01'", "as": "time_aux"},
        {"type": "formula", "expr": "time(datum.time_aux)", "as": "time"},
        {"type": "formula", "expr": "datum._source.severity", "as": "severity"},
        {"type": "aggregate", "groupby": ["severity", "time"]} #, "fields": ["count"], "ops": ["sum"], "as": ["total"]},
        {"type": "joinaggregate", "groupby": ["time"], "fields": ["count"], "ops": ["sum"], "as": ["total"]},
        {"type": "collect", "sort": {"field": "time"}}
      ]
    },
    {
      "name": "severities",
      "values": [
        {"id": 0, "severity": "Total"},
        {"id": 1, "severity": "Critical"},
        {"id": 2, "severity": "High"},
        {"id": 3, "severity": "Medium"},
        {"id": 4, "severity": "Low"}
      ]
    },
    {
      "name": "totals",
      "source": "vulns",
      "transform": [
        {"type": "aggregate", "groupby": ["time"], "fields": ["count"], "ops": ["sum"], "as": ["total"] },
        {"type": "formula", "expr": "trim('Total')", "as": "severity"},
        {"type": "collect", "sort": {"field": "time"}},
      ]
    },
    {
      "name": "selected",
      "on": [
        {"trigger": "clear", "remove": true},
        {"trigger": "!shift", "remove": true},
        {"trigger": "!shift && clicked", "insert": "clicked"},
        {"trigger": "shift && clicked", "toggle": "clicked"}
      ]
    }
  ],
  "scales": [
    {
      "name": "x",
      "type": "time",
      "domain": {"data": "vulns", "field": "time"},
      "range": "width",
      "nice": {"interval": "month", "step": 1}
    },
    {
      "name": "y",
      "type": "linear",
      "domain": {"data": "vulns", "field": "total"},
      "range": "height",
    },
    {
      "name": "color",
      "type": "ordinal",
      "domain": {"data": "severities", "field": "severity"},
      "range": ["#3a8594", "#7B1A1A", "#D31407", "#FFA500", "#FFD700"]
    }
  ],
  "axes": [
    {
      "scale": "x", 
      "orient": "bottom", 
      "labelFontSize": "15",
      "grid": "True",
      "labelFontWeight": "bold",
      "labelOverlap": "true"
    },
    {
      "scale": "y", 
      "orient": "left",
      "grid": "True",
      "labelFontSize": "15",
      "labelFontWeight": "bold",
      "title": "Nº vulnerabilidades",
      "titleFontSize": "15"
    },
  ],
  "legends": [
    {
      "stroke": "color",
      "title": "Severidad",
      "titleFontSize": "25",
      "labelFontSize": "20"
      "encode": {
        "symbols": {
          "name": "legendSymbol",
          "interactive": true,
          "update": {
            "fill": {"value": "transparent"},
            "strokeWidth": {"value": 2},
            "opacity": [
              {"test": "!length(data('selected')) || indata('selected', 'value', datum.value)", "value": 0.7},
              {"value": 0.15}
            ],
            "size": {"value": 64}
          }
        },
        "labels": {
          "name": "legendLabel",
          "interactive": true,
          "update": {
            "opacity": [
              {"test": "!length(data('selected')) || indata('selected', 'value', datum.value)", "value": 1},
              {"value": 0.25}
            ]
          }
        }
      }
    }
  ],
  "marks": [
    {
      "type": "group",
      "from": {
        "facet": {
          "name": "series",
          "data": "vulns",
          "groupby": "severity"
        }
    },
      "marks": [
        {
          "name": "lines",
          "type": "line",
          "from": {"data": "series"},
          "encode": {
            "enter": {
              "x": {"scale": "x", "field": "time"},
              "y": {"scale": "y", "field": "count"},
              "stroke": {"scale": "color", "field": "severity"},
              "interpolate": {"value": "monotone"},
            },
            "update": {
              "strokeOpacity": {"value": 1}
              "strokeWidth": {"value": 4}
              "strokeOpacity": [
                {"test": "!length(data('selected')) || indata('selected', 'value', datum.severity)", "value": 0.7 },
                {"value": 0.05}
              ],
            },
            "hover": {
              "strokeOpacity": {"value": 0.5},
              "strokeWidth": {"value": 8}
            }
          }
        },
        {
          "type": "symbol",
          "from": {"data": "series"},
          "encode": {
            "enter": {
              "x": {"scale": "x", "field": "time"},
              "y": {"scale": "y", "field": "count"},
              "shape": {"value": "circle"},
              "fill": {"scale": "color", "field": "severity"},
              "size": {"value": 150}
            },
            "update": {
              "strokeOpacity": {"value": 1},
              "fillOpacity": [
                {"test": "datum.severity == isSelected", "value": 1},
                {"value": 0}
              ]
            }
          }
        },
        {
          "name": "numbers",
          "type": "text",
          "from": {"data": "series"},
          "encode": {
            "enter": {
              #"sort": {"field": "time"}
              "align": {"value": "center"},
              "baseline": {"value": "bottom"},
              "fill": {"value": "#333"}
              "fontSize": {"value": "20"}
            },
            "update": {
              "x": {"scale": "x", "field": "time", "band": 0.5},
              "y": {"scale": "y", "field": "count", "offset": -5},
              "text": {"signal": "datum.count"},
              "fillOpacity": [
                {"test": "datum.severity == isSelected", "value": 1},
                {"value": 0}
              ]
            }
          }
        }
      ]
    },
    {
      "name": "total_line",
      "type": "line",
      "from": {"data": "totals"},
      "encode": {
        "enter": {
          "x": {"scale": "x", "field": "time"},
          "y": {"scale": "y", "field": "total"},
          "stroke": {"scale": "color", "field": "severity"},
          "interpolate": {"value": "monotone"},
        },
        "update": {
          "strokeOpacity": {"value": 1}
          "strokeWidth": {"value": 4}
          "strokeOpacity": [
            {"test": "!length(data('selected')) || indata('selected', 'value', datum.severity)", "value": 0.7 },
            {"value": 0.05}
          ],
        },
        "hover": {
          "strokeOpacity": {"value": 0.5},
          "strokeWidth": {"value": 8}
        }
      }
    },
    {
      "type": "symbol",
      "from": {"data": "totals"},
      "encode": {
        "enter": {
          "x": {"scale": "x", "field": "time"},
          "y": {"scale": "y", "field": "total"},
          "shape": {"value": "circle"},
          "fill": {"scale": "color", "field": "severity"},
          "size": {"value": 150}
        },
        "update": {
          "strokeOpacity": {"value": 1},
          "fillOpacity": [
            {"test": "datum.severity == isTotalSelected", "value": 1},
            {"value": 0}
          ]
        }
      }
    },
    {
      "name": "numbers",
      "type": "text",
      "from": {"data": "totals"},
      "encode": {
        "enter": {
          #"sort": {"field": "time"}
          "align": {"value": "center"},
          "baseline": {"value": "bottom"},
          "fill": {"value": "#333"}
          "fontSize": {"value": "20"}
        },
        "update": {
          "x": {"scale": "x", "field": "time", "band": 0.5},
          "y": {"scale": "y", "field": "total", "offset": -5},
          "text": {"signal": "datum.total"},
          "fillOpacity": [
            {"test": "datum.severity == isTotalSelected", "value": 1},
            {"value": 0}
          ]
        }
      }
    }
  ]
}

"}}

