{"title":"[VulnAna] - dashboard 1 - evolución puntuaciones","type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v5.json",
  "padding": 5,
  "autosize": "fit",
    "title": {
    "text": "Evolución de Puntuaciones",
    "encode": {
      "title": {
        "enter": {
          "fontSize": {"value": 25}
        }
      }
    }
  },
  "signals": [
    {
      "name": "isSelected",
      "value": 0,
      "on": [ 
        {
        "events": {"source": "scope", "type": "mouseover", "markname": "lines"},
        "update": "datum.category"
        },
        {
        "events": {"source": "scope", "type": "mouseout", "markname": "lines"},
        "update": "{}"
        }
      ]
    },
    {
      "name": "clear", "value": true,
      "on": [
        {
          "events": "mouseup[!event.item]",
          "update": "true",
          "force": true
        }
      ]
    },
    {
      "name": "shift", "value": false,
      "on": [
        {
          "events": "@legendSymbol:click, @legendLabel:click",
          "update": "event.shiftKey",
          "force":  true
        }
      ]
    },
    {
      "name": "clicked", "value": null,
      "on": [
        {
          "events": "@legendSymbol:click, @legendLabel:click",
          "update": "{value: datum.value}",
          "force":  true
        }
      ]
    },
  ],
  "data": [
    {
      "name": "reports",
      "url": {
        "index": "vulnana_report*", 
        "body": {
          "query": {
            "match_all": {
            }
          }
        }
      },
      "format": {"property": "hits.hits"},
      "transform": [
        {"type": "formula", "expr": "(month(datum._source.timestamp)+1) < 10 ? '0'+(month(datum._source.timestamp)+1) : month(datum._source.timestamp)+1", "as": "month"},
        {"type": "formula", "expr": "'15/'+datum.month+'/'+year(datum._source.timestamp)", "as": "time_aux"},
        {"type": "formula", "expr": "year(datum._source.timestamp)+'-'+datum.month+'-01'", "as": "time_aux"},
        {"type": "formula", "expr": "time(datum.time_aux)", "as": "time"}
      ]
    },
    {
      "source": "reports"
      "name": "scores"
      "transform": [
        {
          "type": "flatten",
          "fields": ["_source.scanned_assets"],
          "as": ["scanned_assets"]
        },
        {
          "type": "project",
          "fields": ["scanned_assets.category_name", "scanned_assets.score", "time"],
          "as": ["category", "score", "time"]
        },
        {
          "type": "filter",
          "expr": "datum.category != 'network_equipment'"
        },
      ]
    },
    {
      "name": "selected",
      "on": [
        {"trigger": "clear", "remove": true},
        {"trigger": "!shift", "remove": true},
        {"trigger": "!shift && clicked", "insert": "clicked"},
        {"trigger": "shift && clicked", "toggle": "clicked"}
      ]
    }
  ],
  "scales": [
    {
      "name": "x",
      "type": "time",
      "domain": {"data": "scores", "field": "time"},
      "range": "width",
      "nice": {"interval": "month", "step": 1}
    },
    {
      "name": "y",
      "type": "linear",
      "domain": {"data": "scores", "field": "score"},
      "range": "height",
      "padding": 0.1
    },
    {
      "name": "color",
      "type": "ordinal",
      "range": {"scheme": "tableau10", "count": 5} #"range": "category",
      "domain": {"data": "scores", "field": "category"}
    }
  ],
  "axes": [
    {
      "scale": "x", 
      "orient": "bottom", 
      "grid": "True",
      "labelFontSize": "15",
      "labelFontWeight": "bold",
    }, 
    {
      "scale": "y", 
      "orient": "left",
      "grid": "True",
      "labelFontSize": "15",
      "labelFontWeight": "bold",
      "title": "Puntuación",
      "titleFontSize": "15"
    },
  ],
  "legends": [
    {
      "stroke": "color",
      "title": "Categorías",
      "titleFontSize": "25",
      "labelFontSize": "20"
      "encode": {
        "symbols": {
          "name": "legendSymbol",
          "interactive": true,
          "update": {
            "fill": {"value": "transparent"},
            "strokeWidth": {"value": 2},
            "opacity": [
              {"test": "!length(data('selected')) || indata('selected', 'value', datum.value)", "value": 0.7},
              {"value": 0.15}
            ],
            "size": {"value": 64}
          }
        },
        "labels": {
          "name": "legendLabel",
          "interactive": true,
          "update": {
            "opacity": [
              {"test": "!length(data('selected')) || indata('selected', 'value', datum.value)", "value": 1},
              {"value": 0.25}
            ]
          }
        }
      }
    }
  ],
  "marks": [
    {
      "type": "group",
      "from": {
        "facet": {
          "name": "series",
          "data": "scores",
          "groupby": "category"
        }
    },
      "marks": [
        {
          "name": "lines",
          "type": "line",
          "from": {"data": "series"},
          "encode": {
            "enter": {
              "x": {"scale": "x", "field": "time"},
              "y": {"scale": "y", "field": "score"},
              "stroke": {"scale": "color", "field": "category"},
              "interpolate": {"value": "monotone"},
            },
            "update": {
              #"strokeOpacity": {"value": 1}
              "strokeOpacity": [
                {"test": "!length(data('selected')) || indata('selected', 'value', datum.category)", "value": 0.7 },
                {"value": 0.05}
              ],
              "strokeWidth": [
                {"test": "datum.category === 'global'", "value": 8},
                {"test": "datum.category != 'global'", "value": 3},
              ]
            },
            "hover": {
              "strokeOpacity": {"value": 0.5},
              "strokeWidth": {"value": 8}
            }
          }
        },
        {
          "type": "symbol",
          "from": {"data": "series"},
          "encode": {
            "enter": {
              "x": {"scale": "x", "field": "time"},
              "y": {"scale": "y", "field": "score"},
              "shape": {"value": "circle"},
              "fill": {"scale": "color", "field": "category"},
              "size": {"value": 150}
            },
            "update": {
              "strokeOpacity": {"value": 1},
              "fillOpacity": [
                {"test": "datum.category == isSelected", "value": 1},
                {"value": 0}
              ]
            }
          }
        },
        {
          "name": "numbers",
          "type": "text",
          "from": {"data": "scores"},
          "encode": {
            "enter": {
              "align": {"value": "center"},
              "baseline": {"value": "bottom"},
              "fill": {"value": "#333"}
              "fontSize": {"value": "20"}
            },
            "update": {
              "x": {"scale": "x", "field": "time", "band": 0.5},
              "y": {"scale": "y", "field": "score", "offset": -5},
              "text": {"signal": "datum.score"},
              "fillOpacity": [
                {"test": "datum.category == isSelected", "value": 1},
                {"value": 0}
              ]
            }
          }
        }
      ]
    }
  ]
}"}}

