{"title":"[VulnAna] - dashboard 4 - ciclo de vida vulnerabilidades","type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v5.json",
  "autosize": {"type": "fit", "resize": true, "contains	": "padding"}
  "padding": 5
  "title": {
    "text": "Ciclo de Vida Vulnerabilidades de un Activo",
    "encode": {
      "title": {
        "enter": {
          "fontSize": {"value": 25}
        }
      }
    }
  },
  "signals": [
    {
      "name": "isSelected",
      "value": 0,
      "on": [ 
        {
        "events": {"source": "scope", "type": "mouseover", "markname": "assumed_rect"},
        "update": "datum.vuln_name"
        },
        {
        "events": {"source": "scope", "type": "mouseout", "markname": "assumed_rect"},
        "update": "{}"
        }
      ]
    },
  ],
  "data": [
    {
      "name": "vulns",
      "url": {
        "index": "vulnana_results*",
        "body": {
          "size": 10000,
          "query": {
            "bool": {
              "filter": [
                "%dashboard_context-filter_clause%"
              ]
            }
          }
        }
      },
      "format": {"property": "hits.hits"},
      "transform": [
        {"type": "formula", "expr": "time(datum._source.timestamp)", "as": "epoch"},
        {"type": "formula", "expr": "datum._source.vuln_name", "as": "vuln"},
        {"type": "formula", "expr": "datum._source.asset_ip", "as": "ip"},
        {"type": "formula", "expr": "datum._source.port", "as": "port"},
        {"type": "formula", "expr": "datum._source.severity", "as": "severity"},
        {"type": "formula", "expr": "datum._source.CVSS", "as": "CVSS"},
        {"type": "formula", "expr": "datum._source.solution_type", "as": "solution"}
        {"type": "formula", "expr": "datum._source.assumed_risk", "as": "assumed_risk"}
        {"type": "formula", "expr": "datum.vuln+': '+datum.port", "as": "vuln_name"}
      ]
    },
    {
      "name": "processed",
      "source": "vulns",
      "transform": [
        {
          "type": "aggregate",
          "groupby": ["vuln_name","ip"],
          "fields": ["epoch", "epoch", "severity", "port", "CVSS"],
          "ops": ["min", "max", "max", "max", "max"],
          "as": ["min", "max", "severity", "port", "CVSS"]
        },
        {
          "type": "collect",
          "sort": {
            "field": ["CVSS"],
            "order": ["descending"]
          }
        },
      ]
    },
    {
      "name": "metadata_1",
      "source": "processed",
      "transform": [
        {
          "type": "aggregate",
          "fields": ["ip"],
          "ops": ["min"],
          "as": ["min_ip"]
        },
      ]
    },
    {
      "name": "filtered_1",
      "source": "processed",
      "transform": [
        {"type": "filter", "expr": "indata('metadata_1', 'min_ip', datum.ip)"},
      ]
    },
    {
      "name": "metadata_2",
      "source": "filtered_1",
      "transform": [
        {
          "type": "aggregate",
          "fields": ["vuln"],
          "ops": ["count"],
          "as": ["vuln_count"]
        },
      ]
    },
    {
      "name": "filtered_2",
      "source": "filtered_1",
      "transform": [
        {"type": "filter", "expr": "datum.min != datum.max"}
        {"type": "identifier", "as": "idx"}
        {"type": "filter", "expr": "datum.idx < 11"}
      ]
    },
    {
      "name": "assumed",
      "source": "vulns",
      "transform": [
        {"type": "filter", "expr": "datum.assumed_risk == true"}
        {
        "type": "aggregate",
        "groupby": ["vuln_name","ip"],
        "fields": ["epoch", "epoch", "severity", "port"],
        "ops": ["min", "max", "max", "max"],
        "as": ["min", "max", "severity", "port"]
        },
        {"type": "filter", "expr": "indata('metadata_1', 'min_ip', datum.ip)"},
        {"type": "filter", "expr": "datum.min != datum.max"}
      ]
    },
    {
      "name": "severities",
      "values": [
        {"id": 0, "severity": "High"},
        {"id": 1, "severity": "Medium"},
        {"id": 2, "severity": "Low"}
        {"id": 3, "severity": "Assumed Risk"}
      ]
    }
  ],
  "scales": [
    {
      "name": "x",
      "type": "time",
      "domain": {"data": "filtered_2", "fields": ["min", "max"]},
      "domainMax": {"signal": "now()"},
      "range": "width",
    },
    {
      "name": "y",
      "type": "band",
      "domain": {"data": "filtered_2", "field": "vuln_name"},
      "range": [0, {"signal": "height"}],
    },
    {
      "name": "color",
      "type": "ordinal",
      "domain": {"data": "severities", "field": "severity"},
      "range": ["#D31407", "#FFA500", "#FFD700", "#701dde"]
    },
    {
      "name": "ip",
      "type": "ordinal",
      "domain": {"data": "metadata_1", "field": "min_ip"},
    },
    {
      "name": "vuln_count",
      "type": "ordinal",
      "domain": {"data": "metadata_2", "field": "vuln_count"},
    }
  ],
  "axes": [
    {
      "scale": "x", 
      "orient": "bottom", 
      "labelFontSize": "15",
      "labelFontWeight": "bold",
      "format": "%Y-%b-%d",
      "labelOverlap": "true"
    }
  ],
  "legends": [
    {
      "title": "Activo",
