          "fontSize": {"value": 10}
        },
        "update": {
          "fillOpacity": [
              {"test": "datum.vuln_name == isSelected", "value": 1},
              {"value": 0}
          ]
        }
      }
    },
    {
      "type": "text",
      "from": {"data": "metadata_2"},
      "encode": {
        "enter": {
          "x": {"signal": "containerSize()[0]/2"},
          "y": {"signal": "containerSize()[1]-120"},
          "angle": {"value": -90},
          "fill": {"value": "#000"},
          "text": {"value": ". . ."},
          "fontSize": {"value": 20},
          "tooltip": {"value": "Hay más de 10 vulnerabilidades"},
        },
        "update": {
          "fillOpacity": [
              {"test": "datum.vuln_count > 10", "value": 1},
              {"value": 0}
          ]
        }
      }
    }
  ]
}"}}

